import React, {Component} from 'react';
import {WritterWrapper,
    WritterItem} from '../style';

class Writter extends Component {
    render() {
        return (
            <WritterWrapper>
                <WritterItem>
                    <img className = 'img' alt = 'no support!!!' src = '//upload.jianshu.io/users/upload_avatars/13213889/7314c5cc-ca7f-4542-b914-2c8dffaf324d.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/96/h/96/format/webp'></img>
                    <h3 className = 'autor'>无限猴子</h3>
                </WritterItem>
            </WritterWrapper>
        )
    }
}

export default Writter;
